import React from 'react'
import BookList from './Components/BookList'
import Navbar from './Components/Navbar'
import ThemeContext from './contexts/ThemeContext'
// import SongList from './Components/SongList'

function App() {
  return (
    <>
          {/* <SongList/> */}
          <ThemeContext>
                   <Navbar/>
                   <BookList/>
          </ThemeContext>
    </>
  )
}

export default App
